description:
Aletta and Audrey are at an interview and are trying hard to make it in a male dominated work-force. As they wait anxiously for their turn to be interviewed they over hear Johnny criticizing them for their attempts to get a decent job. However, these women are not to be stepped on and show Johnny how women can dominate males.

